function FilterByName() {
    return (
        <>
            <label
                className=""
                for="gender">Género:</label>
            <select
                class="form__input-text"
                name="gender"
                id="gender">


                <option value="all" selected>Gryffindor</option>
                <option value="female">Slytherin</option>
                <option value="male">Hufflepuff</option>
                <option value="no-binary">No binario</option>
            </select>
        </>

    )
};
export default FilterByName;
